import { bgColorGreen, bgColorR1 } from "../../Styles/backGroundColor";
import { DefaultLineChart } from "./defaultVictoryLine";
import React from "react";

export function CIVictoryLine(props){
    //colors
    const colors = ["white", bgColorGreen, bgColorR1]

    //make function to generate multiple lines
    function renderMultipleLines() {
        return props.data.map((element, index) => (
          <DefaultLineChart key={index} data={element} lineColor={colors[index]} bg="red"/>
        ));}

    return (
        <div>
            {renderMultipleLines()}
        </div>
    )

}
